import React from 'react';
import s from './Friend.module.css';

const Friend = (props) => {
    return (
        (<div className = {s.setting}>
    <div className = {s.ava}> 
           <img src = 'https://wl-adme.cf.tsp.li/resize/728x/jpg/214/dda/5fae555a5a94a24fd073a9a423.jpg' />
    </div>
    <div className = {s.name}>
        Yulia
        </div>
    </div>
    )
    );
}

export default Friend;
